import Slider from 'rc-slider';
import 'rc-slider/assets/index.css';
import './NavBar.css';
// import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
// import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import { useState } from 'react';

function NavBar(props){

    const [format, setFormat] = useState("hex");

    function handleChange(event){
        setFormat(event.target.value);
        // alert(event.target.value)
        props.handleChange(format)
        // console.log();
    }
    return (
        <header className="navbarr">
            <div className="logo">
            // eslint-disable-next-line
                <a href="#">ColorPicker</a>
            </div>
            <div className='container'>
                <span>Level:{props.lev}</span>
            </div>
            <div className='slider'>
            <Slider 
            defaultValue={props.lev}
            min={200} 
            max={900} 
            step={100} 
            onAfterChange={props.changeColor}/>
            </div>
            <div className='select-cont'>
                <Select value={format} onChange={handleChange}>
                    <MenuItem value="hex">Hex- #ffffff</MenuItem>
                    <MenuItem value="rgb">rgb - rgb(255,255,255)</MenuItem>
                    <MenuItem value="rgba">rgba - rgba(255,255,255,0.3)</MenuItem>
                    {/* <MenuItem value="no hash">no Hash - ffffff</MenuItem> */}
                </Select>
            </div>
        </header>
    )
}

export default NavBar;
